import {Route} from 'react-router'
import ExpenseTracker from './components/ExpenseTracker';

ReactDOM.render(
<BrowserRouter>
    <Routes>
      <Route path='/' element={<App/>}></Route>
      <Route path='/add' element={<ExpenseTracker/>}></Route>
    </Routes>

</BrowserRouter>
  ,
  document.getElementById('root')
);

